fn test_main() {
    let root = 0x2f6a832fd61aec0c03c0d6da26d668b8e9d4746998d6be238b85ba437241c518;
    let nullifier_hash= 0x16397f79558d5424a2875a5d187befb0ed23ecb1c658733368b6e3ae771ba2ca;
